function App() {
  return (
    <div className="App">
      <img src="https://source.unsplash.com/400x300/?car" alt="Car 1"></img>
      <img src="https://source.unsplash.com/400x300/?auto" alt="Car 2"></img>
      <img src="https://source.unsplash.com/400x300/?vehicle" alt="Car 3"></img>
      <img
        src="https://source.unsplash.com/400x300/?sportscar"
        alt="Car 4"
      ></img>
      <img
        src="https://source.unsplash.com/400x300/?luxurycar"
        alt="Car 5"
      ></img>
    </div>
  );
}

export default App;
